import React, { useEffect, useRef } from "react";
import carousel1 from "../images/Home.jpg";
import carousel2 from "../images/hom2.jpg";
import carousel3 from "../images/hom3.jpg";
import "bootstrap/dist/css/bootstrap.min.css";
import "bootstrap/dist/js/bootstrap.bundle.min";

const Carousel = () => {
  const carouselRef = useRef(null);

  useEffect(() => {
    if (carouselRef.current) {
      new window.bootstrap.Carousel(carouselRef.current, {
        interval: 3000, // Auto-slide every 3 seconds
        ride: "carousel",
        pause: "hover",
        wrap: true,
      });
    }
  }, []);

  return (
    <div
      ref={carouselRef}
      id="carouselExampleCaptions"
      className="carousel slide w-full max-w-screen-lg mx-auto overflow-hidden rounded-lg shadow-lg"
      data-bs-ride="carousel"
    >
      {/* Indicators */}
      <div className="carousel-indicators">
        <button
          type="button"
          data-bs-target="#carouselExampleCaptions"
          data-bs-slide-to="0"
          className="active"
          aria-current="true"
          aria-label="Slide 1"
        ></button>
        <button
          type="button"
          data-bs-target="#carouselExampleCaptions"
          data-bs-slide-to="1"
          aria-label="Slide 2"
        ></button>
        <button
          type="button"
          data-bs-target="#carouselExampleCaptions"
          data-bs-slide-to="2"
          aria-label="Slide 3"
        ></button>
      </div>

      {/* Carousel Inner */}
      <div className="carousel-inner h-[400px]">
        <div className="carousel-item active h-full relative">
          <img src={carousel1} className="w-full h-full object-cover" alt="Slide 1" />
          <div className="absolute bottom-10 left-0 right-0 text-center text-white bg-black bg-opacity-50 py-2">
            <h2 className="text-2xl font-bold">"Adventure Awaits â€“ Go Find It!"</h2>
          </div>
        </div>
        <div className="carousel-item h-full relative">
          <img src={carousel2} className="w-full h-full object-cover" alt="Slide 2" />
          <div className="absolute bottom-10 left-0 right-0 text-center text-white bg-black bg-opacity-50 py-2">
            <h2 className="text-2xl font-bold">"Travel Far, Live More!"</h2>
          </div>
        </div>
        <div className="carousel-item h-full relative">
          <img src={carousel3} className="w-full h-full object-cover" alt="Slide 3" />
          <div className="absolute bottom-10 left-0 right-0 text-center text-white bg-black bg-opacity-50 py-2">
            <h2 className="text-2xl font-bold">"Discover the World, One Journey at a Time!"</h2>
          </div>
        </div>
      </div>

      {/* Left & Right Controls */}
      <button
        className="carousel-control-prev"
        type="button"
        data-bs-target="#carouselExampleCaptions"
        data-bs-slide="prev"
      >
        <span className="carousel-control-prev-icon" aria-hidden="true"></span>
        <span className="visually-hidden">Previous</span>
      </button>
      <button
        className="carousel-control-next"
        type="button"
        data-bs-target="#carouselExampleCaptions"
        data-bs-slide="next"
      >
        <span className="carousel-control-next-icon" aria-hidden="true"></span>
        <span className="visually-hidden">Next</span>
      </button>
    </div>
  );
};

export default Carousel;
